// src/components/Faculty/FacultyList.js
import React from 'react';
import { useSelector } from 'react-redux';

const FacultyList = () => {
  const faculty = useSelector((state) => state.faculty);

  return (
    <div>
      <h2>Faculty List</h2>
      <ul>
        {faculty.map(member => (
          <li key={member.id}>{member.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default FacultyList;
